import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import "bootstrap/dist/css/bootstrap.css";
const app = require("express")();

ReactDOM.render(<App />, document.getElementById("root"));
const cors = require("cors");
app.use(cors());
